Ever since its premiere, Chuck has been a modestly rated show, and narrowly escaped cancellation several seasons in a row. In 2009, Chuck was renewed for a third season following a two-month campaign mounted by fans.[8] The season's initial 13-episode order was subsequently extended to nineteen episodes.[9] A major sponsorship deal between NBC and the Subway restaurant chain was also announced to help cover costs of the third season. The third season premiered with a 2-hour event on Sunday, January 10, 2010 before returning to its normal timeslot.[10] A 13-episode fourth season was picked up by NBC on May 13, 2010. The season later received an order for 11 additional episodes on October 18, 2010. Unlike the third season which was held as a midseason replacement, Chuck appears on NBC's fall 2010 schedule. Season 4 began airing on September 20, 2010.
